import React from 'react';
import { Homepage } from './components/Homepage';
import './App.scss';

function App() {
  return (
    <div className="App">
      <img src="brand.svg" alt="brand logo" className="brand-logo"></img>
      <section>
        <Homepage />
      </section>
    </div>
  );
}

export default App;
